import React, { Component } from 'react';
import {IoLogIn} from 'react-icons/io';
import { FaUsers } from 'react-icons/fa';

class TopNavRightIcon extends Component {
    
    render() {
        return (
       <ul class="list-inline2">
            <li>
                <div className='select'>
                    <a href="login.html" title="register" target="_blank">Login<IoLogIn/></a>
                    <a href="register.html" title="register" target="_blank">Join<FaUsers/></a>
                </div>
            </li>
            <li>
                <a href="tel:01028496209" title="Call me" target="_blank" class="mobile">01028496209</a>
            </li>
            <li>
                <a href="mailto:info@yourdomain.com" title="Mail" target="_blank">info@yourdomain.com</a>
            </li>
        </ul>
    );
    }
};

export default TopNavRightIcon;
